var agendaUrl=global_settings.urlCORS+"api/agendaapi/";registrationModule.factory("agendaRepository",function(n){return{get:function(){return n.get(agendaUrl+"0-0")},getByEmpleado:function(e,t){return n.get(agendaUrl+"1-"+e+"-"+t)},eliminar:function(e){return n.get(agendaUrl+"2-"+e)},add:function(e,t,r,a){return n.post(agendaUrl+e+"-idContrato-"+t+"-"+r+"-"+a)},"delete":function(){return n["delete"](agendaUrl)},put:function(e){return n.put(agendaUrl,e)}}});